import React from 'react'
import { auth } from '../firebase';

const UserInfo = () => {
    return (
        <>
            <img src={auth.currentUser.photoURL} alt='' />
            <p>{auth.currentUser.displayName}</p>
        </>
    )
};

export default UserInfo
